select comp_cast_type.kind AS comp_cast_type_kind_0, company_name.country_code AS country_code, company_name.id AS company_name_id_2, company_name.name AS name, company_type.id AS company_type_id_4, company_type.kind AS company_type_kind_5, complete_cast.movie_id AS complete_cast_movie_id_6, complete_cast.subject_id AS subject_id, link_type.id AS link_type_id_8, link_type.link AS link, movie_companies.note AS note, movie_info.info AS info, movie_info.movie_id AS movie_info_movie_id_12, movie_keyword.keyword_id AS keyword_id
from comp_cast_type, company_name, company_type, complete_cast, link_type, movie_companies, movie_info, movie_keyword, movie_link
 where (comp_cast_type.id = complete_cast.status_id) And (comp_cast_type.id = complete_cast.subject_id) And (comp_cast_type.kind = '__LIKE__complete%') And (comp_cast_type.kind = 'cast') And (company_name.id = movie_companies.company_id) And (company_type.id = movie_companies.company_type_id) And (complete_cast.status_id = comp_cast_type.id) And (complete_cast.subject_id = comp_cast_type.id) And (link_type.id = movie_link.link_type_id) And (movie_companies.movie_id = complete_cast.movie_id) And (movie_companies.movie_id = movie_keyword.movie_id) And (movie_companies.note IS NULL) And (movie_info.info in ('Sweden', 'Norway', 'Germany', 'Denmark', 'Swedish', 'Denish', 'Norwegian', 'German', 'English')) And (movie_info.movie_id = movie_link.movie_id) And (movie_keyword.movie_id = movie_companies.movie_id) And (movie_keyword.movie_id = movie_link.movie_id)